import logo from "./logo.svg";
import "./App.css";
import Register from "./screens/Register";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/Register" element={<Register />} />
      </Routes>
    </Router>
  );
}

export default App;
